const projects = [
	{
		title: 'Inventory Dashboard',
		description: `Manufacturing database software for tracking / modifying inventory from an clean, intuitive UI, while tracking all FDA required data on the backend for reports.`,
		link: null,
		techstack: ['Python', 'MySQL', 'React', 'Javascript', 'AWS'],
	},
	{
		title: 'KNN from CSV',
		description: `Developed a command line tool for building and saving K Nearest Neighbor classifiers for existing data and spreadsheets. Simplified the workflow of building classifiers to make machine learning more accessible to users in non-technical roles.`,
		link: `https://github.com/jacksonet00/KNN-from-CSV`,
		techstack: ['Python', 'SKLearn', 'Pandas', 'Numpy'],
	},
	{
		title: 'Completify',
		link: `https://github.com/jacksonet00/Completify`,
		description: `Designed and developed a tasks app with a minimalistic user interface for creating and completing tasks, drag and drop reordering, and auto-organization. Built a backend database and API for user-specific task lists, making Completify lists available across multiple devices.`,
		techstack: ['React', 'Node.js', 'Express', 'PostgreSQL', 'Heroku'],
	},
	{
		title: 'Weather Deck',
		link: `https://github.com/jacksonet00/Weather-Deck`,
		description: `Created a customizable weather dashboard to display relevant weather data from a user-specified set of locations. Connected to the Open Weather Map API to quickly retrieve the necessary data to drive the application.`,
		techstack: ['React', 'Node.js', 'Third-Party API'],
	},
];

export default projects;

